However if there is an obscure conflict with France I couldn’t find that fits your search you could look at; 

* The French military mission to Japan (1869-1880) where 300 french soldiers assisted modernising the Japanese army to counter western imperialism which wasn’t an armed conflict but marked increased Japanese influence over Korea and regional expansion 
*The Bombardment of Shimonoseki (1863–64), A minor skirmish fought between Japan’s shogunate regime and western powers including Britain and a small French element for failure to open its borders to trade.
